INSERT INTO `item_template` VALUES (213, 13, 3, 'Bùa Trí Tuệ', 'Tiềm năng và sức mạnh của bạn sẽ nhận được gấp đôi trong 1 khoảng thời gian, kể từ lúc mua', 1403, -1, 1, 0, 0, 500, -1, -1, -1);
INSERT INTO `item_template` VALUES (214, 13, 3, 'Bùa Mạnh Mẽ', 'Cú đấm của bạn sẽ mạnh hơn. Tăng 150% sức đánh hiện có khi bạn đánh Quái trong 1 khoảng thời gian, kể từ lúc mua', 1404, -1, 1, 0, 0, 500, -1, -1, -1);
INSERT INTO `item_template` VALUES (215, 13, 3, 'Bùa Da Trâu', 'Tăng sức chịu đòn cho bạn. Khi bị quái đánh, máu sẽ mất ít hơn, chỉ còn 50% bình thường. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua', 1405, -1, 1, 0, 0, 250, -1, -1, -1);
INSERT INTO `item_template` VALUES (216, 13, 3, 'Bùa Oai Hùng', 'Bạn sẽ oai vệ hơn. Quái Thủ Lĩnh sẽ sợ bạn và đánh bạn yếu đi, y như con quái thường. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua', 1406, -1, 1, 0, 0, 700, -1, -1, -1);
INSERT INTO `item_template` VALUES (217, 13, 3, 'Bùa Bất Tử', 'Bạn sẽ không bao giờ bị quái đánh chết. Thay vào đó chỉ còn 1 máu. Tuy nhiên bạn phải bơm máu mới có thể đánh lại. Có tác dụng trong 1 khoảng thời gian kể từ lúc mua.', 1407, -1, 1, 0, 0, 700, -1, -1, -1);
INSERT INTO `item_template` VALUES (218, 13, 3, 'Bùa Dẻo Dai', 'Thể lực của bạn sẽ không bao giờ giảm khi bùa này có tác dụng. Có tác dụng trong 1 khoảng thời gian, kể từ lúc mua', 1408, -1, 1, 0, 0, 100, -1, -1, -1);
INSERT INTO `item_template` VALUES (219, 13, 3, 'Bùa Thu Hút', 'Vật phẩm bạn đánh văng ra nếu là của bạn, nó sẽ tự bay vào người. Bạn sẽ không phải nhặt bằng tay. Có tác dụng trong 1 khoảng thời gian, kể từ lúc mua', 1409, -1, 1, 0, 0, 250, -1, -1, -1);
