INSERT INTO `task_main_template` VALUES (0, 'Nhiệm vụ đầu tiên', 'Chi tiết nhiệm vụ');
INSERT INTO `task_main_template` VALUES (1, 'Nhiệm vụ tập luyện', 'Mộc nhân được đặt nhiều tại %1, ngay trước nhà ông %2\r\nHãy đánh ngã 20 mộc nhân, \r\nsau đó quay về nhà báo cáo với ông %2\r\nĐể đánh, hãy chạm nhanh 2 lần vào đối tượng\r\nThưởng 1000 sức mạnh\r\nThưởng 1000 tiềm năng\r\nThưởng 200tr vàng');
INSERT INTO `task_main_template` VALUES (2, 'Nhiệm vụ tìm thức ăn', 'Tìm đến %3, tiêu diệt bọn quái %4 và nhặt về 10 đùi gà\nThưởng 1500 sức mạnh\nThưởng 1500 tiềm năng\nThưởng 300tr vàng\nHọc được kỹ năng bay');
INSERT INTO `task_main_template` VALUES (3, 'Tìm kiếm sao băng', 'Đi khám phá xem vật thể lạ vừa rơi xuống hành tinh\nThưởng 2000 sức mạnh\nThưởng 2000 tiềm năng\nThưởng 400tr vàng');
INSERT INTO `task_main_template` VALUES (4, 'Nhiệm vụ khó khăn', 'Đi tới %6, tiêu diệt lũ %4 mẹ\nThưởng 2500 sức mạnh\nThưởng 2500 tiềm năng\nThưởng 500tr vàng');
INSERT INTO `task_main_template` VALUES (5, 'Nhiệm vụ gia tăng sức mạnh', 'Hãy đi tập luyện để gia tăng sức mạnh\nThưởng 3000 sức mạnh\nThưởng 3000 tiềm năng\nThưởng 500tr vàng');
INSERT INTO `task_main_template` VALUES (6, 'Nhiệm vụ trò chuyện', 'Đi tới trạm tàu vũ trụ, trò chuyện với %7');
INSERT INTO `task_main_template` VALUES (7, 'Nhiệm vụ giải cứu', 'Lên đường tiêu diệt bọn %9, giải cứu %8\nQuay về báo cáo với %7 để nhận thưởng');
INSERT INTO `task_main_template` VALUES (8, 'Nhiệm vụ ân nhân xuất sắc', 'Về %1, gặp và trò chuyện với %8\nSau đó về nhà kể lại mọi chuyện với ông %2');
INSERT INTO `task_main_template` VALUES (9, 'Nhiệm vụ tiên học lễ', 'Tìm đường tới %11, trò chuyện với %10 và xin làm đệ tử');
